int	ical_strings_check_word(char* word)
{
	signed char	line = 0;
	int	count = 0;
	int letter = 0;

	do
	{
		line = state_machine_table[line][symbol_table[word[letter]]];
		letter++;
	}
	while (line > 0 && word[letter] != '\0');

	if (line < 0)
		line = (0-line) - 1;
	else if ((line = state_machine_table[line][symbol_table[0]]) < 0)
		line = (0-line) - 1;
	else
		line = -1;

	if (line >= 0)
	{
		for (count=letter;count < ical_strings_table[line].length;count++)
		{
			if (toupper(word[count]) != ical_strings_table[line].name[count])
			{
				line = -1;
				break;
			}
		}
	}
	return line;
}
